import styled from 'styled-components';

export const ContainerHome = styled.div``;


export const Card = styled.div`
  h2{
    text-align: center;
    font-weight: bold;

    font-size: 26px;
  }

  p{
    text-align: center;
    font-size: 18px;
  }

  button{
    background: #203040;
    color: #FFFFFF;
    border: none;
    padding: 10px 20px;
    border-radius: 5px;
  }
`;
